import React, { useState, useEffect } from 'react';
import weaponsAPI from '../services/dsApi';

const HomePage = () => {
  const [weapon, setWeapon] = useState([]);
  useEffect(() => {
    weaponsAPI().then((resp) => {
      console.log(resp)
      setWeapon(resp);
    });
  }, []);
  let armas = [];
  if (weapon.length > 0) armas = Object.values(weapon.ds3_weapons)
  console.log(armas)
  return (
    <section>
      {weapon.map((Post) => (
        <div>{Post.ds3_weapons.name}</div>
      ))}
    </section>
  );
};

export default HomePage;
